Kasey - Another One Bites The Dust
Added: July 07, 2010

&quot;Hey ladies and gents Preston here bringing you this weeks bangbus update. this week we got a treat for one of my co workers max.the guy has been begging me that he has what it takes to step in my shoes..not my shoes literally but you know what i mea..so out we go to get this guys feet wet and we run into this cutie out in the HOOD i mean the place was a mess but her beauty stood out so i had to go for it..she was a bit young you can tell in the way she spoke but man was she a looker and quite nice so we talked i asked for some direction and asked her if she can show me and she did...so in she comes into the best day of her life...NOT!!! lol Stay Tuned!!!&quot;
